import React from 'react';
import { Link } from 'react-router-dom';

const Card = ({ dentist, addToFavorites }) => {
  return (
    <div className="card">
      <h2>{dentist.name}</h2>
      <p>Username: {dentist.username}</p>
      <button onClick={() => addToFavorites()}>ADD FAV</button>
      <Link to={`/dentist/${dentist.id}`}>Ver detalles</Link>
    </div>
  );
};

export default Card;
